import React from "react";
import { Holiday } from "../types/Holiday";

interface HolidayListProps {
  holidays: Holiday | null; // Change to Holiday | null for a single holiday
}

const HolidayList: React.FC<HolidayListProps> = ({ holidays }) => {
  if (!holidays) return <p>No holidays found.</p>;

  return (
    <>
      <div className="card">
        <div className="card-body text-center">
          <h4>{holidays["Holiday Name"]}</h4>
          <p>{holidays.Date}</p>
          <p>{holidays.Type}</p>
        </div>
      </div>
    </>
  );
};

export default HolidayList;
